import './App.css';
import { Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';

function App() {
  return (
    <div>
      <div>
      <Routes>
        <Route path={'/'} element={<Navbar/>}></Route>
      </Routes>
    </div>
    </div>
  );
}

export default App;
